function getTextureInfo(tbl, texture)
	if (type(texture) == "number") then
		DoIt.Debug("Debug: "..tostring(texture))
		local t1, t2 = texture, tbl.IconTextureNames[texture];
		if (not t2) then return nil end;
		local t3 = "Interface/ICONS/"..t2;
		return t1, t2, t3;
	elseif (type(texture) == "string") then
		if (texture:len() > 16 and texture:sub(1, 16):lower() == "interface/icons/") then
			texture = texture:sub(17);
		end
		local t1, t2 = tbl.IconTextureIds[texture], texture;
		local t3 = "Interface/ICONS/"..t2;
		return t1, t2, t3;
	end
end

--
--- Args id, name, or path... returns id, name, path (returns all three is you only know id or name/path)
---
function DoIt.GetTextureInfo(texture)
	--if (DoIt.IsClassic) then
	--	return getTextureInfo(TexturesCommon, texture)
	--else
		local a1, a2, a3 = getTextureInfo(TexturesCommon, texture)
		if (a3) then return a1, a2, a3 end
		return getTextureInfo(TexturesRetailExclusive, texture)
	--end
end
